import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './Components/Home/HomePage';
import NavMenu from '../src/Components/Common/NavMenu'

function App() {
  return (
    <Router>
    <div>
      {/* Navigation, header, or any other global components can go here */}

      {/* Define routes for different sections/pages */}
      <NavMenu/>

        <Route path="/" exact component={HomePage } />



      {/* Footer or any other global components can go here */}
    </div>
  </Router>
  );
}

export default App;
